import React from "react";
import {
    Container,
    Card,
    CardPrice,
    CardName,
    Front,
    Back,
    Overlay,
} from "./styles/ProdutosListStyle";

const ProdutosList = ({ produtos }) => {
    return (
        <Container>
            {produtos.map((produto, i) => (
                <Card key={i}>
                    <Front>
                        <Overlay />
                        <img
                            key={i}
                            style={{ backgroundImage: url(produto.hdurl) }}
                        />
                    </Front>
                    <Back>
                        <CardName key={i + 1}>{produto.explanation}</CardName>
                        <CardPrice key={i + 2}>{produto.price}</CardPrice>
                    </Back>
                </Card>
            ))}
        </Container>
    );
};

export default ProdutosList;
